  <style>
    :root {
      --sidebar-w: 260px;
    }
    body {
      margin: 0; padding: 16px; font-family: system-ui, -apple-system, Segoe UI, Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif;
      background: #fafafa; color: #222;
    }
    #vis {
      display: flex;
      gap: 20px;
      align-items: flex-start;
      width: 100%;
    }
    /* Forzamos orden: bindings (selects) a la IZQUIERDA, grÃ¡fico a la DERECHA */
    #vis > .vega-bindings {
      order: 0;
      width: var(--sidebar-w);
      min-width: var(--sidebar-w);
      display: flex;
      flex-direction: column;
      gap: 12px;
      padding: 12px;
      background: #fff;
      border: 1px solid #e5e5e5;
      border-radius: 12px;
      box-shadow: 0 1px 2px rgba(0,0,0,0.06);
    }
    #vis > .vega-embed {
      order: 1;
      flex: 1;
      min-width: 0;
    }
    .vega-bindings label {
      display: block;
      font-size: 13px;
      font-weight: 600;
      margin-bottom: 6px;
      color: #333;
    }
    .vega-bindings select {
      width: 100%;
      padding: 8px 10px;
      border: 1px solid #d0d5dd;
      border-radius: 8px;
      background: #fff;
      font-size: 14px;
      color: #111;
      outline: none;
      transition: border-color .15s ease, box-shadow .15s ease;
    }
    .vega-bindings select:focus {
      border-color: #6ea8fe;
      box-shadow: 0 0 0 3px rgba(110,168,254,0.25);
    }
    .title {
      margin: 0 0 12px 0;
      font-weight: 700;
      letter-spacing: .2px;
    }
  </style>
